import React, { useState } from 'react';

 import { Container, Wrapper } from './styles';
 import {Input} from "../../components/Input"
import Header from '../../components/Header';
import { Select } from '../../components/Select';

const CreatePet: React.FC = () => {

  const FRUITS = ["apple", "banana", "melon"] as const;

type Fruit = typeof FRUITS[number];


  type State = {
    fruit: Fruit;
  };
  const [state, setState] = useState<State>({
    fruit: "banana"
  });

  return (
    <>
    <Header></Header>
    <Wrapper> 
      <Container>
          <form>    
          <Input
                noMargin={false}
                onChange={() => null}
                label="Name"
            />
             <Input
                noMargin={false}
                onChange={() => null}
                label="Specie"
            />
             <Select<FRUITS>
                 value={state.fruit}
                noMargin={false}
                onChange={() => null}
                label="Age"
                options={FRUITS}
            />
             <Input
                noMargin={false}
                onChange={() => null}
                label="Gender"
            />
             <Input
                noMargin={false}
                onChange={() => null}
                label="Link of Image"
            />
             <Input
                noMargin={false}
                onChange={() => null}
                label="Description"
            />
          </form>
          </Container>
      </Wrapper>
      </>

  );
}

export default CreatePet;
